import torch
import torchvision
import torchvision.transforms as transforms

"""https://pytorch.org/tutorials/beginner/blitz/cifar10_tutorial.html#sphx-glr-beginner-blitz-cifar10-tutorial-py

![이미지.JPG](data:image/jpeg;base64,)

다음 단계를 순서대로 수행합니다.

다음을 사용하여 CIFAR10 교육 및 테스트 데이터 세트를 로드하고 정규화합니다. torchvision

컨벌루션 신경망 정의

손실 함수 정의

훈련 데이터로 네트워크 훈련

테스트 데이터에서 네트워크 테스트

What are Torchvision transforms?

Transforms are common image transformations available in the torchvision. transforms module. They can be chained together using Compose .
"""

#Torchvision 데이터 세트의 출력은 [0, 1] 범위의 PILImage 이미지입니다. 정규화된 범위 [-1, 1]의 텐서로 변환합니다.
#transforms.ToTensor(): torch.Tensor로 변환시킨다. 
#파이토치에서 제공하는 데이터셋 로드
#Pytorch는 DataLoader라고 하는 괜찮은 utility를 제공한다. 간단하게 생각하면 DataLoader 객체는 학습에 쓰일 데이터 전체를 보관했다가, 
#train 함수가 batch 하나를 요구하면 batch size 개수만큼 데이터를 꺼내서 준다고 보면 된다.

transform = transforms.Compose(
    [transforms.ToTensor(),
     transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))]) #정규화

batch_size = 4

trainset = torchvision.datasets.CIFAR10(root='./data', train=True, #제공하는 CIFAR10 데이터셋 가져옴
                                        download=True, transform=transform)
trainloader = torch.utils.data.DataLoader(trainset, batch_size=batch_size, #batchsize 만큼 데이터를 꺼내옴
                                          shuffle=True, num_workers=2) #shuffle은 데이터를 섞을 때 이용. 동일한 데이터의 반복은 모델의 훈련을 약화시킴

testset = torchvision.datasets.CIFAR10(root='./data', train=False, #제공하는 CIFAR10 데이터셋 가져옴
                                       download=True, transform=transform)
testloader = torch.utils.data.DataLoader(testset, batch_size=batch_size, #batchsize 만큼 데이터를 꺼내옴
                                         shuffle=False, num_workers=2)

classes = ('plane', 'car', 'bird', 'cat',
           'deer', 'dog', 'frog', 'horse', 'ship', 'truck')

import matplotlib.pyplot as plt
import numpy as np

# functions to show an image


def imshow(img):
    img = img / 2 + 0.5     # unnormalize
    npimg = img.numpy()
    plt.imshow(np.transpose(npimg, (1, 2, 0)))
    plt.show()


# get some random training images
dataiter = iter(trainloader)
images, labels = dataiter.next()

# show images  훈련이미지
imshow(torchvision.utils.make_grid(images))
# print labels
print(' '.join(f'{classes[labels[j]]:5s}' for j in range(batch_size)))

"""컨볼루션 신경망 정의

이전에 신경망 섹션에서 신경망을 복사하고 3채널 이미지를 사용하도록 수정합니다(정의된 1채널 이미지 대신).
"""

import torch.nn as nn
import torch.nn.functional as F


class Net(nn.Module):
    def __init__(self):
        super().__init__()
        self.conv1 = nn.Conv2d(3, 6, 5)
        self.pool = nn.MaxPool2d(2, 2)
        self.conv2 = nn.Conv2d(6, 16, 5)
        self.fc1 = nn.Linear(16 * 5 * 5, 120)
        self.fc2 = nn.Linear(120, 84)
        self.fc3 = nn.Linear(84, 10)

    def forward(self, x):
        x = self.pool(F.relu(self.conv1(x)))
        x = self.pool(F.relu(self.conv2(x)))
        x = torch.flatten(x, 1) # flatten all dimensions except batch
        x = F.relu(self.fc1(x))
        x = F.relu(self.fc2(x))
        x = self.fc3(x)
        return x


net = Net()

""" 손실 함수 및 옵티마이저 정의
 
분류 교차 엔트로피 손실과 운동량과 함께 SGD를 사용합시다.
"""

import torch.optim as optim

criterion = nn.CrossEntropyLoss()
optimizer = optim.SGD(net.parameters(), lr=0.001, momentum=0.9) #모멘텀 SGD

"""네트워크 훈련

이것은 상황이 흥미로워지기 시작할 때입니다. 데이터 반복자를 반복하고 네트워크에 입력을 공급하고 최적화하기만 하면 됩니다.
"""

for epoch in range(2):  # loop over the dataset multiple times

    running_loss = 0.0
    for i, data in enumerate(trainloader, 0):
        # get the inputs; data is a list of [inputs, labels]
        inputs, labels = data

        # zero the parameter gradients
        optimizer.zero_grad()

        # forward + backward + optimize
        outputs = net(inputs)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()

        # print statistics
        running_loss += loss.item()
        if i % 2000 == 1999:    # print every 2000 mini-batches
            print(f'[{epoch + 1}, {i + 1:5d}] loss: {running_loss / 2000:.3f}')
            running_loss = 0.0

print('Finished Training')

"""# 테스트 데이터에서 네트워크 **테스트**

훈련 데이터 세트에 대해 2번의 패스에 대해 네트워크를 훈련했습니다. 그러나 네트워크가 학습한 것이 있는지 확인해야 합니다.

우리는 신경망이 출력하는 클래스 레이블을 예측하고 이를 ground-truth와 대조하여 이를 확인할 것입니다. 예측이 정확하면 샘플을 올바른 예측 목록에 추가합니다.

알겠습니다. 첫 번째 단계입니다. 익숙해지기 위해 테스트 세트의 이미지를 표시해 보겠습니다.
"""

dataiter = iter(testloader)
images, labels = dataiter.next()

# print images 테스트이미지 
imshow(torchvision.utils.make_grid(images))
print('GroundTruth: ', ' '.join(f'{classes[labels[j]]:5s}' for j in range(4)))

#모델 주입

outputs = net(images)

"""파이썬 언더바 설명 https://mingrammer.com/underscore-in-python/


"""

#출력은 10개의 클래스에 대한 에너지입니다. 
#클래스에 대한 에너지가 높을수록 네트워크는 이미지가 특정 클래스의 이미지라고 더 많이 생각합니다. 따라서 가장 높은 에너지의 지수를 구합시다.

_, predicted = torch.max(outputs, 1) #출력이 두개인데 앞의 값 무시하려고 언더바한 듯

print('Predicted: ', ' '.join(f'{classes[predicted[j]]:5s}'
                              for j in range(4)))

#네트워크가 전체 데이터 세트에서 어떻게 수행되는지 살펴보겠습니다.

correct = 0
total = 0
# since we're not training, we don't need to calculate the gradients for our outputs
with torch.no_grad():
    for data in testloader:
        images, labels = data
        # calculate outputs by running images through the network
        outputs = net(images)
        # the class with the highest energy is what we choose as prediction
        _, predicted = torch.max(outputs.data, 1)
        total += labels.size(0)
        correct += (predicted == labels).sum().item()

print(f'Accuracy of the network on the 10000 test images: {100 * correct // total} %')

#what are the classes that performed well, and the classes that did not perform well:
#class간의 정확도 비교

# prepare to count predictions for each class
correct_pred = {classname: 0 for classname in classes}
total_pred = {classname: 0 for classname in classes}

# again no gradients needed
with torch.no_grad():
    for data in testloader:
        images, labels = data
        outputs = net(images)
        _, predictions = torch.max(outputs, 1)
        # collect the correct predictions for each class
        for label, prediction in zip(labels, predictions):
            if label == prediction:
                correct_pred[classes[label]] += 1
            total_pred[classes[label]] += 1


# print accuracy for each class
for classname, correct_count in correct_pred.items():
    accuracy = 100 * float(correct_count) / total_pred[classname]
    print(f'Accuracy for class: {classname:5s} is {accuracy:.1f} %')